                    <img src="\logo192.png" alt="Avatar" style="width:300px;height:300px;"></img>
                </div>
                <div class="flip-card-back">
                    <h1>John Doe</h1>
                    <p>Architect  Engineer</p>
                    <p>We love that guy</p>
                </div>
            </div>
        </div>
    );
}
